import React, {Component} from 'react'
import { Redirect, Switch, Route } from 'react-router-dom'
import Dash from './Dash';

class Login extends Component {
    state = {
        login : false,
    }

    redirect = () => {
            return <Switch>
            <Redirect from='/login' to='/username'/>
            <Route path='/username' component={Dash}/>
                </Switch>
    }

    login = () => {
        this.redirect()
    }

    render () {
        return(
            <div>
                <form>
                    <input 
                        className = "input"
                        id = "username"
                        placeholder = "Username"
                    >
                    </input>
                    <input 
                        className = "input"
                        id = "password"
                        placeholer = "Password"
                    >
                    </input>
                    <button 
                        className = "paybutton"
                        onClick = {()=>{this.redirect()}}
                    >
                        LOGIN
                    </button>
                </form>
            </div>
        )
    }
}

export default Login
